	dispatch->BarrierCreate = (BarrierCreateFunc_t) crSPUFindFunction(table, "BarrierCreate");
	dispatch->BarrierDestroy = (BarrierDestroyFunc_t) crSPUFindFunction(table, "BarrierDestroy");
	dispatch->BarrierExec = (BarrierExecFunc_t) crSPUFindFunction(table, "BarrierExec");
	dispatch->Begin = (BeginFunc_t) crSPUFindFunction(table, "Begin");
	dispatch->BindTexture = (BindTextureFunc_t) crSPUFindFunction(table, "BindTexture");
	dispatch->Bitmap = (BitmapFunc_t) crSPUFindFunction(table, "Bitmap");
	dispatch->BlendColorEXT = (BlendColorEXTFunc_t) crSPUFindFunction(table, "BlendColorEXT");
